import AppLayout from "../components/AppLayout";
import Head from "next/head";

const Profile = () => {
  return (
    <div>
      <Head>
        <title>NodeBird | Profile</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList header="following list" />
        <FollowList header="follower list" />
      </AppLayout>
    </div>
  );
};

export default Profile;
